class Form extends Component {
  componentDidMount() {
    typeformEmbed.makeWidget(
      embedElement,
      "https://dhakon.typeform.com/to/A7bW0z",
      {
        hideHeaders: true,
        hideFooter: true,
        opacity: 75,
        onSubmit: function () {
          Router.push(routes.LANDING);

          // axios.get(`/forms/A7bW0z/responses`, {
          //   headers: {
          //     'Authorization': `Bearer DLrXyVaPwwS7VhFoL84VwKvcqc5rP8x9fEARcVJRt5Sg`
          //   }
          // })
          //   .then(function (response) {
          //     // handle success
          //     // console.log('response success : ', response.data.items[0]);

          //     // const res = response.data.items[0]

          //   })
          //   .catch(function (error) {
          //     // handle error
          //     console.log('response error : ', error);
          //   })

          axios.post('/message', {
            body: 'Hello from Node',
            to: '+6281286974581',
            from: 'Dhakon'
          })
            .then(function (response) {
              console.log('response success', response);
            })
            .catch(function (error) {
              console.log('response error', error);
            });

        }
      }
    );
  }

  handleSubmit = () => {
    Router.push(routes.LANDING);
  };

  render() {
    return (
      <AppWithAuthentication>
        <AppWrapper id="embedElement" />
      </AppWithAuthentication>
    );
  }
}

const mapStateToProps = state => ({
  authUser: state.sessionState.authUser
});

export default connect(mapStateToProps)(Form);
